import { memo, useMemo } from 'react';
import {
  Avatar,
  Box,
  Chip,
  IconButton,
  ListItem,
  ListItemButton,
  Tooltip,
  Typography
} from '@mui/material';
import FavoriteBorderRoundedIcon from '@mui/icons-material/FavoriteBorderRounded';
import MoreHorizRoundedIcon from '@mui/icons-material/MoreHorizRounded';
import DeleteOutlineRoundedIcon from '@mui/icons-material/DeleteOutlineRounded';

const SongRow = ({ song, onPlay, onDelete, showDelete = false }) => {
  const initials = useMemo(
    () => song?.songName?.[0]?.toUpperCase() || '♪',
    [song?.songName]
  );

  const handleRowClick = () => {
    onPlay?.(song);
  };

  const handleDeleteClick = (event) => {
    event.stopPropagation();
    onDelete?.(song);
  };

  const handleIconClick = (event) => {
    event.stopPropagation();
  };

  return (
    <ListItem disablePadding sx={{ width: '100%' }}>
      <ListItemButton
        onClick={handleRowClick}
        sx={{
          borderRadius: 3,
          display: 'flex',
          alignItems: 'center',
          gap: 2,
          px: { xs: 1.5, sm: 2 },
          py: { xs: 1.25, sm: 1.5 },
          transition: 'all 200ms ease',
          backgroundColor: 'rgba(18,18,18,0.65)',
          boxShadow: 'inset 0 0 0 1px rgba(255,255,255,0.02)',
          '&:hover': {
            transform: 'translateY(-1px)',
            backgroundColor: 'rgba(29,185,84,0.08)',
            boxShadow: '0 10px 18px rgba(0,0,0,0.25)'
          },
          '&:focus-visible': {
            outline: '2px solid rgba(29,185,84,0.5)',
            outlineOffset: 2
          }
        }}
      >
        <Avatar
          variant="rounded"
          src={song?.imgSrc || undefined}
          alt={song?.songName || 'cover'}
          sx={{
            width: 56,
            height: 56,
            borderRadius: 2,
            bgcolor: 'rgba(255,255,255,0.04)',
            flexShrink: 0
          }}
        >
          {initials}
        </Avatar>

        <Box sx={{ minWidth: 0, flexGrow: 1 }}>
          <Typography variant="subtitle1" fontWeight={600} noWrap>
            {song?.songName || 'Untitled track'}
          </Typography>
          <Typography variant="body2" color="text.secondary" noWrap>
            {song?.artist || 'Unknown Artist'}
          </Typography>
        </Box>

        {song?.category && (
          <Chip
            label={song.category}
            size="small"
            sx={{
              borderRadius: 2,
              bgcolor: 'rgba(34,197,94,0.12)',
              color: 'primary.main',
              border: '1px solid rgba(34,197,94,0.35)',
              fontWeight: 500
            }}
          />
        )}

        <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5, ml: 'auto' }}>
          <Tooltip title="Add to favourites">
            <IconButton aria-label="Add to favourites" onClick={handleIconClick}>
              <FavoriteBorderRoundedIcon fontSize="small" />
            </IconButton>
          </Tooltip>
          <Tooltip title="More options">
            <IconButton aria-label="More options" onClick={handleIconClick}>
              <MoreHorizRoundedIcon fontSize="small" />
            </IconButton>
          </Tooltip>
          {showDelete && (
            <Tooltip title="Delete song">
              <IconButton
                aria-label="Delete song"
                color="error"
                onClick={handleDeleteClick}
              >
                <DeleteOutlineRoundedIcon fontSize="small" />
              </IconButton>
            </Tooltip>
          )}
        </Box>
      </ListItemButton>
    </ListItem>
  );
};

export default memo(SongRow);
